import TheAll from "./components/TheAll.vue";
import TheSub from "./components/TheSub.vue";
import TheIndex from "./components/TheIndex.vue";


export default [
    {
        name: "TheIndex",
        path: '/',
        component: TheIndex
    },
    {
        name: "TheSub",
        path: '/thesub',
        component: TheSub
    },
    {
        name: "TheAll",
        path: '/theall/:slug',
        slug: "everytime",
        component: TheAll
    }
]
